import request from '@/utils/request'

const baseUrl = `/log/order/orderHistory`

export default {
    pageFind(page, limit) {   // 派送员分页查看历史订单信息
        return request({
            url: `${baseUrl}/pageFind/${page}/${limit}`,
            method: 'get'
        })
    },

    deleteHistoryById(id) {   // 派送员单个删除历史订单信息
        return request({
            url: `${baseUrl}/${id}`,
            method: 'delete'
        })
    },

    deleteHistoryByIds(ids) {   // 派送员多个删除历史订单信息
        return request({
            url: `${baseUrl}/list`,
            method: 'delete',
            data: ids
        })
    }
}
